import React from 'react';
import { View, Text, Button, Image, StyleSheet } from 'react-native';
import Admire from '../assets/Admire.png'
import stylsp3 from '../styles/stylsp3';

const Pantalla3 = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text>Persona Admirada</Text>
      <Image source = {require('../assets/Admire.png')} style={stylsp3.image} />
      <Text> Miguel Angel Alvarez </Text>
      <Text>04 de Enero de 1953</Text>
      <Text>El es mi abuelo. Lo admiro ya que el es que me apoya con mis estudios</Text>
      {}
      <Button
        title="Regresar al Menú"
        onPress={() => navigation.navigate('Bienvenida')}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});

export default Pantalla3;
